1. isomorphic-fetch 1.1. 警告1.2. 安装1.2.1. NPM1.2.2. Bower1.3. 用法1.4. License1. isomorphic-fetch 
Fetch 为  node and Browserify 建立。建立在 GitHub's WHATWG Fetch polyfill基础上，参考文档。
1.1. 警告

这将把fetch作为全局添加，使其API在客户端和服务器之间保持一致。
你必须带上自己的ES6 Promise 兼容的polyfill，我推荐es6-promise.

为了易于维护和向后兼容的原因, 这个库将 一直是一个polyfill。作为一种“安全”的替代方法，它不改变全局，考虑fetch-ponyfill.
1.2. 安装
1.2.1. NPM
npm install --save isomorphic-fetch es6-promise

1.2.2. Bower
bower install --save isomorphic-fetch es6-promise

1.3. 用法
require('es6-promise').polyfill();
require('isomorphic-fetch');

fetch('//offline-news-api.herokuapp.com/stories')
    .then(function(response) {
        if (response.status >= 400) {
            throw new Error("Bad response from server");
        }
        return response.json();
    })
    .then(function(stories) {
        console.log(stories);
    });

