1. React Autosuggest1.1. Demo1.2.  特性1.3. 安装1.4. 基础用法1.5. Props1.6. 开发1.7. License





1. React Autosuggest
1.1. Demo
查看主页 和  Codepen 示例。
1.2.  特性

WAI-ARIA compliant, 支持ARIA属性和键盘交互
对移动端友好
很好的插入到 Flux 和 Redux 应用程序
 完全控制suggestions rendering
Suggestions 可以表示为 简单的 列表 或 多个部分
Suggestions 可以asynchronously检索
如果你想的话，可以设置列表的第一个suggestion高亮
 支持样式使用 CSS Modules, Radium, Aphrodite, JSS,  和更多
你决定 什么时候显示suggestions (比如. 当用户输入2个或多个字符时)
总是渲染 suggestions (适用于移动端和模态框)
将任意的属性传递给输入框 (例如. placeholder, type, onChange, onBlur, 或者  任何其他), 或者 对输入的渲染进行完全控制 (用于与其他库的集成)
全面测试

1.3. 安装
yarn add react-autosuggest

或者
npm install react-autosuggest --save

您还可以使用独立的UMD构建：


1.4. 基础用法
import Autosuggest from 'react-autosuggest';

// 假设你有一个你想要自动推荐的语言列表。
const languages = [
  {
    name: 'C',
    year: 1972
  },
  {
    name: 'Elm',
    year: 2012
  },
  ...
];

// 教Autosuggest如何计算给定输入值的建议。
const getSuggestions = value => {
  const inputValue = value.trim().toLowerCase();
  const inputLength = inputValue.length;

  return inputLength === 0 ? [] : languages.filter(lang =>
    lang.name.toLowerCase().slice(0, inputLength) === inputValue
  );
};

// 当suggestion被点击的时候, Autosuggest  基于点击的suggestion来填充输入
//教Autosuggest如何计算每个给定的输入值suggestion.
const getSuggestionValue = suggestion => suggestion.name;

// 运用你的想象力（imagination）来渲染建议。
const renderSuggestion = suggestion => (

    {suggestion.name}

);

class Example extends React.Component {
  constructor() {
    super();

    // Autosuggest 是一个受控组件.
    // 这意味着你需要提供一个输入值和onChange事件处理方法来更新这个值。
    // Suggestions也需要被提供给Autosuggest，他们的初始都为空，因为Autosuggest是关闭的
    this.state = {
      value: '',
      suggestions: []
    };
  }

  onChange = (event, { newValue }) => {
    this.setState({
      value: newValue
    });
  };

  // 每次你 需要更新建议的时候Autosuggest将调用这个函数
  // 上面 你已经实现了它的逻辑，所以 只管使用它便是
  onSuggestionsFetchRequested = ({ value }) => {
    this.setState({
      suggestions: getSuggestions(value)
    });
  };

  // 每次你需要清除建议的时候Autosuggest将调用这个函数
  onSuggestionsClearRequested = () => {
    this.setState({
      suggestions: []
    });
  };

  render() {
    const { value, suggestions } = this.state;

    // Autosuggest将传递这些props到输入框
    const inputProps = {
      placeholder: 'Type a programming language',
      value,
      onChange: this.onChange
    };

    // 最后, 渲染它!
    return (

    );
  }
}

