如果你在一个页面有多个Autosuggest，请使用它




suggestions (required)
用来显示的建议数组。唯一的要求是，suggestions是一个数组。这个数组中的项可以任意 形式。
对于一个简单的建议列表，suggestions中的每一项都代表一个建议。这取决于你的每一个建议都是什么样子。例如:
const suggestions = [
  {
    text: 'Apple'
  },
  {
    text: 'Banana'
  },
  {
    text: 'Cherry'
  },
  {
    text: 'Grapefruit'
  },
  {
    text: 'Lemon'
  }
];

对于 多 章节,suggestions的每一项代表一个单一的章节。  同样，这取决于每个章节的形式。例如:
const suggestions = [
  {
    title: 'A',
    suggestions: [
      {
        id: '100',
        text: 'Apple'
      },
      {
        id: '101',
        text: 'Apricot'
      }
    ]
  },
  {
    title: 'B',
    suggestions: [
      {
        id: '102',
        text: 'Banana'
      }
    ]
  },
  {
    title: 'C',
    suggestions: [
      {
        id: '103',
        text: 'Cherry'
      }
    ]
  }
];


onSuggestionsFetchRequested (required)
每次你可能需要更新suggestions的时候这个函数被调用. 它有以下特征:
function onSuggestionsFetchRequested({ value, reason })

where:

value - 当前输入框的值
reason - 字符串描述 为什么 onSuggestionsFetchRequested 被调用. 可能的值有:
'input-changed' - 用户输入的东西
'input-focused' - 输入框获得焦点
'escape-pressed' - 用户按下 Escape 来清除输入框(对空输入给出建议)
'suggestions-revealed' - 用户按下 Up 或者 Down 来显示建议
'suggestion-selected' - 当alwaysRenderSuggestions={true}时，用户选中一个建议




onSuggestionsClearRequested (required 除非 alwaysRenderSuggestions={true})
你每次需要清除suggestions时调用此函数
在这个函数中，你要做的就是设置suggestions 为[]。

注意: 当 alwaysRenderSuggestions={true}, 你不需要实现这个函数。

getSuggestionValue (required)
当用户使用Up 和 Down 键导航建议时， 应该根据突出显示的建议设置输入框的值。你设计了建议的模型。因此，告诉Autosuggest如何将建议映射到输入框值是你的责任。
这个函数得到了一个有问题的建议，它应该返回一个字符串。例如:
function getSuggestionValue(suggestion) {
  return suggestion.text;
}


renderSuggestion (required)
Use your imagination to define how suggestions are rendered.利用你的想象力来定义如何渲染建议。
签名为:
function renderSuggestion(suggestion, { query, isHighlighted })

where:

suggestion - 用来渲染的建议
query - 用来 高亮显示匹配的字符串。作为输入框的用户类型，query将等于输入框的值。然后，如果用户使用Up or Down来进行交互，输入框将得到高亮显示的建议的值, 但是，query的值仍然等于在Up 和 Down之前输入框的值。
isHighlighted - 建议是否被高亮显示.

它 应该返回一个字符串或 ReactElement. 例如:
function renderSuggestion(suggestion) {
  return (
    {suggestion.text}
  );
}

重点: renderSuggestion必须是一个纯函数(我们根据这个假设优化了渲染性能).

inputProps (required)
Autosuggest 是一个 受控组件。因此，您必须向输入框传递至少一个value 和一个onChange回调。你也可以传递其他的属性。例如:
const inputProps = {
  value,          // 通常来自应用程序state
  onChange,       // 数次输入框的值改变时被调用。
  onBlur,         // 当输入框失去 焦点时被用调用。 比如 当用户按下Tab键
  type: 'search',
  placeholder: 'Enter city or postcode'
};


inputProps.onChange (required)
签名如下:
function onChange(event, { newValue, method })

where:

newValue - 输入框的新值
method -  改变怎样发生的字符串描述。可能的 值有:
'down' - 用户按下 Down
'up' - 用户按下 Up
'escape' - 用户按下 Escape
'enter' - 用户按下 Enter
'click' - 用户在建议上点击 (或者 敲击)
'type' - 上面的方法都没有 (通常意味着用户输入了一些东西、但也可能是他们按下了空格、将一些东西粘贴到输入中，等等)




inputProps.onBlur (optional)
签名是:
function onBlur(event, { highlightedSuggestion })

where:

highlightedSuggestion - 如果没有高亮显示的建议，那么在输入失去焦点或者为null之前就会高亮显示的建议。


onSuggestionSelected (optional)
当建议被选择 时调用。他有如下签名
function onSuggestionSelected(event, { suggestion, suggestionValue, suggestionIndex, sectionIndex, method })

where:

suggestion - 选择的 建议
suggestionValue - 选择的建议的 值(等效于 getSuggestionValue(suggestion))
suggestionIndex - 选择的建议在 suggestions 数组中的索引
sectionIndex - 当渲染多个章节, 这将是选择的建议所在章节在建议 数组中（suggestions）的索引。否则，为null 。
method - 用户怎样 选择章节的字符串描述。可能的 值有:
'click' - 用户在建议上点击 (或者敲击)
'enter' - 用户使用Enter键选择建议




onSuggestionHighlighted (optional)
当高亮显示建议改变时这个函数被调用。下面是它的签名：
function onSuggestionHighlighted({ suggestion })

where:

suggestion - 高亮显示的建议 ，没有高亮显示的建议时为null。


shouldRenderSuggestions (optional)
默认情况下，当输入不是空的时候就会显示建议。请随意覆盖这种行为。
这个函数获得输入的当前值，它应该返回一个布尔值。
例如，仅当输入值至少为3个字符时才显示建议:
function shouldRenderSuggestions(value) {
  return value.trim().length > 2;
}

当 shouldRenderSuggestions 返回 true, **建议只在输入框获得焦点时集中时才
如果您想渲染建议，而不管输入框是否获得焦点，那么设置alwaysRenderSuggestions={true}(在本例中应该忽略shouldRenderSuggestions)。

alwaysRenderSuggestions (optional)
Set 如果想要总是渲染建议，设置alwaysRenderSuggestions={true}
重点: 确保suggestions的初始值与inputProps.value的初始值相对应。例如，如果您想在输入为空时显示所有的建议，那么您的初始状态应该是这样的:
this.state = {
  value: '',
  suggestions: allSuggestions
};


highlightFirstSuggestion (optional)
当 highlightFirstSuggestion={true}, Autosuggest将自动高亮显示第一个建议。默认为 false.

focusInputOnSuggestionClick (optional)
默认情况下, focusInputOnSuggestionClick={true}, 这意味着，每次建议被点击（或者敲击），输入框都会保持聚焦状态。
在 移动设备上，当输入框获得焦点时，原生的键盘会出现。为了隐藏键盘，你可能会想要在建议被点击的时候失去焦点。
你需要这样做


isMobile是一个布尔值，描述了Autosuggest是否 是在移动设备上运行。 你可以使用kaimallea/isMobile, 举个例子来说。

multiSection (可选的)
在默认情况下，Autosuggest渲染了一个简单的建议列表。
如果你想要有一个多章节的 (可以带title), 请设置 multiSection={true}.

renderSectionTitle (required when multiSection={true})
当渲染multiple sections 时, 你需要告诉Autosuggest怎样 渲染一个章节标题。
这个函数获得章节来渲染 (suggestions 数组中的一项), 它将返回一个字符串或者 一个ReactElement. 例如:
function renderSectionTitle(section) {
  return (
    {section.title}
  );
}

如果 renderSectionTitle 返回 null 或者 undefined, 章节标题不会被渲染

getSectionSuggestions (required when multiSection={true})
当渲染多个章节时, 你需要告诉Autosuggest去哪里找到指定的章节。
这个函数获得章节来渲染 (suggestions 数组中的一项),, 它应该返回一个 指定章节中用来渲染的建议数组，例如：
function getSectionSuggestions(section) {
  return section.suggestions;
}

注意: 不带建议的章节不能被渲染。

renderInputComponent (可选)
你不需要指定renderInputComponent，除非你想要自定义输入框的渲染结果。
为了保持Autosuggest的可访问性, renderInputComponent 必须:

渲染一个输入框
传递提供的所有inputProps 到输入框

Example:
const renderInputComponent = inputProps => (


    custom stuff

);

注意: 当使用 renderInputComponent, 你仍需要指定 平常的 inputProps。Autosuggest 将合并inputProps，那些你提供的可以访问到的props(比如 'aria-activedescendant'), 并将传递合并后的 inputProps 到 renderInputComponent.

renderSuggestionsContainer (可选)
你不需要指定renderSuggestionsContainer，除非你想要自定义除了提出这些建议本身之外的内容或者建议容器的行为。例如，你可能想要添加一个自定义的 文本before/after这个建议 列表，或者来自定义建议 容器的滚动行为.
签名如下:
function renderSuggestionsContainer({ containerProps, children, query })

where:

containerProps - props，你必须传递到从renderSuggestionsContainer返回的 最顶层元素。
children - 建议本身. 这取决于你在哪里渲染它们。
query - 与renderSuggestion中的query 一样

例如：
function renderSuggestionsContainer({ containerProps , children, query }) {
  return (

      {children}

        Press Enter to search {query}


  );
}

当 renderSuggestionsContainer 返回一个复合组件 (例如：  反对DOM节点如),你必须 使用复合组件渲染的最顶层元素调用containerProps.ref 。
例如：
import IsolatedScroll from 'react-isolated-scroll';

function renderSuggestionsContainer({ containerProps, children }) {
  const { ref, ...restContainerProps } = containerProps;
  const callRef = isolatedScroll => {
    if (isolatedScroll !== null) {
      ref(isolatedScroll.component);
    }
  };

  return (

      {children}

  );
}


theme (可选)
Autosuggest 没有任何样式.
它使用 react-themeable， 允许你使用 CSS Modules, Radium, Aphrodite, JSS, Inline styles, 和 全局 CSS来为Autosuggest定制样式.
例如, 使用CSS Modules, 这样做:
