1.6. HTTP 身份验证
request.get('http://some.server.com/').auth('username', 'password', false);
// 或者
request.get('http://some.server.com/', {
  'auth': {
    'user': 'username',
    'pass': 'password',
    'sendImmediately': false
  }
});
// 或者
request.get('http://some.server.com/').auth(null, null, true, 'bearerToken');
// 或者
request.get('http://some.server.com/', {
  'auth': {
    'bearer': 'bearerToken'
  }
});

如果传递一个选项对象，auth应该一个包含下面这些值的哈希：

user || username
pass || password
sendImmediately (optional)
bearer (optional)

方法表单接受参数
auth(username, password, sendImmediately, bearer).
sendImmediately 默认为 true， 这将导致发送一个基本的或不记名身份验证头。
如果 sendImmediately 为 false，然后，request 将在收到来自服务器的 401 响应后使用适当的身份验证头进行重试(必须包含 WWW-Authenticate 头
指示所需的身份验证方法).
注意： 还可以使用 URL 本身指定基本身份验证，详细的信息 RFC 1738。
在主机名@ 标志之前，简单地传递user:password:
var username = 'username',
    password = 'password',
    url = 'http://' + username + ':' + password + '@some.server.com';

request({url: url}, function (error, response, body) {
   // Do more stuff with 'body' here
});

摘要身份认证（Digest authentication）是被支持的，当它仅在 sendImmediately 设置为 false工作；
否则，request 将在初始请求时发送一个基本的身份验证，这可能会导致请求失败。
不记名身份验证 (Bearer authentication) 是被支持的，当 bearer的值是可用的时候被激活。
bearer的值可以是一个 String 或者 一个返回String 的 Function。
如果与 defaults 结合，使用一个函数来提供不记名令牌（token）是特别有用的。
因为它允许单个函数在发送请求时提供最后一个已知的令牌，或者动态计算一个令牌。
