1.8. 认证签名（OAuth Signing）
OAuth version 1.0 被支持。默认的签名算法是
HMAC-SHA1:
// OAuth1.0 - 3-legged 服务端流程 (Twitter example)
// step 1
var qs = require('querystring')
  , oauth =
    { callback: 'http://mysite.com/callback/'
    , consumer_key: CONSUMER_KEY
    , consumer_secret: CONSUMER_SECRET
    }
  , url = 'https://api.twitter.com/oauth/request_token'
  ;
request.post({url:url, oauth:oauth}, function (e, r, body) {

  //理想情况下，您可以将主体放在响应中，并构造一个用户单击的 URL(如按钮上的符号)。
  //验证器只有在用户通过了twitter的验证（他们正在授权你的应用程序）后的响应中才可用。

  // step 2
  var req_data = qs.parse(body)
  var uri = 'https://api.twitter.com/oauth/authenticate'
    + '?' + qs.stringify({oauth_token: req_data.oauth_token})
  // 将用户重定向到授权 uri

  // step 3
  // 在用户被重定向回服务器之后
  var auth_data = qs.parse(body)
    , oauth =
      { consumer_key: CONSUMER_KEY
      , consumer_secret: CONSUMER_SECRET
      , token: auth_data.oauth_token
      , token_secret: req_data.oauth_token_secret
      , verifier: auth_data.oauth_verifier
      }
    , url = 'https://api.twitter.com/oauth/access_token'
    ;
  request.post({url:url, oauth:oauth}, function (e, r, body) {
    // 准备代表用户签署已签名的请求
    var perm_data = qs.parse(body)
      , oauth =
        { consumer_key: CONSUMER_KEY
        , consumer_secret: CONSUMER_SECRET
        , token: perm_data.oauth_token
        , token_secret: perm_data.oauth_token_secret
        }
      , url = 'https://api.twitter.com/1.1/users/show.json'
      , qs =
        { screen_name: perm_data.screen_name
        , user_id: perm_data.user_id
        }
      ;
    request.get({url:url, oauth:oauth, qs:qs, json:true}, function (e, r, user) {
      console.log(user)
    })
  })
})

对于 RSA-SHA1 signing, 对 OAuth 选项对象进行以下更改:

传递  signature_method : 'RSA-SHA1'
替代 consumer_secret，指定一个 private_key 字符串到
PEM format 中

对于 PLAINTEXT signing, 对 OAuth 选项对象进行以下更改:

传递 signature_method : 'PLAINTEXT'

通过查询参数或在 oauth1 规范的消费者请求参数部分中描述的一个post主体发送 OAuth 参数:

传递 transport_method : 'query' 或 transport_method : 'body' 到 OAuth
选项对象中。
transport_method 默认为 'header'

为了使用请求主体哈希 你可以

手动地生成 主体哈希并传递它作为一个字符串body_hash: '...'
 传递 body_hash: true 来自动生成主体哈希。

