1.16. Timeouts
大多数对外部服务器的请求都应该有一个超时，以防服务器没有及时响应。如果没有超时，您的代码可能会有一个套接字打开/消耗资源几分钟或更多。
有两种主要类型的超时:连接超时和读取超时。如果在您的客户端尝试建立到远程计算机的连接(对应于套接字上的 connect() 调用 )时，就会出现连接超时。任何时候服务器都太慢了，无法发送响应的一部分，就会出现读取超时。
这两种情况对于请求的错误有不同的影响，因此能够区分它们是很有用的。您可以通过检查 err.code 的 'ETIMEDOUT' 值来检测超时错误。此外，您可以通过检查err.connect 是否被 设置为 true来检测超时是否是连接超时。
request.get('http://10.255.255.1', {timeout: 1500}, function(err) {
    console.log(err.code === 'ETIMEDOUT');
    // Set to `true` 如果超时是一个连接超时，为 `true`，
    // 否则为 `false` 或者 `undefined`
    console.log(err.connect === true);
    process.exit(0);
});

1.17. 示例
  var request = require('request')
    , rand = Math.floor(Math.random()*100000000).toString()
    ;
  request(
