  , function (error, response, body) {
      if(response.statusCode == 201){
        console.log('document saved as: http://mikeal.iriscouch.com/testjs/'+ rand)
      } else {
        console.log('error: '+ response.statusCode)
        console.log(body)
      }
    }
  )

为了向后兼容性，默认情况下不支持响应压缩。
要接受 经过 gzip 压缩的响应，将 gzip 选项设置为 true。
注意，通过 request 传递的主体数据会自动地解压缩，而响应对象未被修改，
如果服务器发送压缩的响应，则响应将会包含压缩的数据。
  var request = require('request')
  request(
    { method: 'GET'
    , uri: 'http://www.google.com'
    , gzip: true
    }
  , function (error, response, body) {
      // body 是经过压缩的响应 主体
      console.log('server encoded the data as: ' + (response.headers['content-encoding'] || 'identity'))
      console.log('the decoded data is: ' + body)
    }
  )
  .on('data', function(data) {
    // 当收到数据时，对它进行解压
    console.log('decoded chunk: ' + data)
  })
  .on('response', function(response) {
    // 为修改 http.IncomingMessage 对象
    response.on('data', function(data) {
      // 接收到的压缩数据
      console.log('received ' + data.length + ' bytes of compressed data')
    })
  })

默认情况下，cookie 是禁用的(否则，它们将在后续请求中使用)。要启用 cookie，将 jar 设置为 true(在 defaults 或 options中)。
var request = request.defaults({jar: true})
request('http://www.google.com', function () {
  request('http://images.google.com')
})

 要使用自定义的 cookie jar (而不是 request 的 全局 cookie jar)， 将 jar  设置为 request.jar() 的实例。(在 defaults 或 options 中)
var j = request.jar()
var request = request.defaults({jar:j})
request('http://www.google.com', function () {
  request('http://images.google.com')
})

或者
var j = request.jar();
var cookie = request.cookie('key1=value1');
var url = 'http://www.google.com';
j.setCookie(cookie, url);
request({url: url, jar: j}, function () {
  request('http://images.google.com')
})

要使用自定义的 cookie 仓库（例如
FileCookieStore，它支持从 JSON 文件中保存和恢复），将它作为一个参数传递给 request.jar():
var FileCookieStore = require('tough-cookie-filestore');
// 注意 - 目前的 'cookies.json' 文件必须存在！
var j = request.jar(new FileCookieStore('cookies.json'));
request = request.defaults({ jar : j })
request('http://www.google.com', function() {
  request('http://images.google.com')
})

该  cookie 仓库必须时一个 tough-cookie 仓库，并且 它必须支持同步操作。参见
CookieStore API 文档
获取细节。
在请求后检查 cookie jar :
var j = request.jar()
request({url: 'http://www.google.com', jar: j}, function () {
  var cookie_string = j.getCookieString(url); // "key1=value1; key2=value2; ..."
  var cookies = j.getCookies(url);
  // [{key: 'key1', value: 'value1', domain: "www.google.com", ...}, ...]
})

